    authDomain: "sistema-ma-andrade.firebaseapp.com",
    databaseURL: "https://sistema-ma-andrade.firebaseio.com",
    projectId: "sistema-ma-andrade",
    storageBucket: "sistema-ma-andrade.appspot.com",
    messagingSenderId: "986375528338",
    appId: "1:986375528338:web:21eb7a106894a75a66eb4b",
    measurementId: "G-8ZK9563MDN"
  };
  // Initialize Firebase
  firebase.initializeApp(firebaseConfig);
  firebase.analytics();

  const db = firebase.firestore();

  db.collection('react').get().then((snapshot)=>{
    snapshot.docs.forEach(doc =>{
      console.log(doc)
    })
  })


ReactDOM.render(
  <React.StrictMode>
